// React Native Bottom Navigation
// https://aboutreact.com/react-native-bottom-navigation/

import 'react-native-gesture-handler';

import * as React from 'react';
import { MaterialCommunityIcons } from '@expo/vector-icons';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

import  HomeScreen  from './modules/home';
import DetailsScreen from './pages/DetailsScreen';
import ProfileScreen from './pages/ProfileScreen';
import SettingsScreen from './pages/SettingsScreen';
import CameraScreen from './pages/CameraScreen';
import CameraScanner from './pages/CameraScanner';
import PhotosScreen from './pages/PhotosScreen';

const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();

const HomeStack = () => {
  return (
    <Stack.Navigator
      initialRouteName="Home"
      screenOptions={{
        headerStyle: { backgroundColor: '#0275d8' },
        headerTintColor: '#fff',
        headerTitleStyle: { fontWeight: 'bold' },
      }}>
      <Stack.Screen
        name="Home"
        component={HomeScreen}
        options={{ title: 'About SuEz Bid0' }}
      />
      <Stack.Screen
        name="Photos"
        component={PhotosScreen}
        options={{ title: 'About SuEz Bidc2' }}
      />
      <Stack.Screen
        name="Details"
        component={DetailsScreen}
        options={{ title: 'Details Page' }}
      />
      <Stack.Screen
        name="Settings"
        component={SettingsScreen}
        options={{ title: 'Profile Page ===' }}
      />
    </Stack.Navigator>
  );
}

const CameraStack = () => {
  return (
    <Stack.Navigator
      initialRouteName="Home"
      screenOptions={{
        headerStyle: { backgroundColor: '#0275d8' },
        headerTintColor: '#fff',
        headerTitleStyle: { fontWeight: 'bold' },
      }}>
      <Stack.Screen
        name="Camera"
        component={CameraScreen}
        options={{ title: 'Camera' }}
      />
    </Stack.Navigator>
  );
}

function ScannerStack() {
  return (
    <Stack.Navigator
      initialRouteName="Home"
      screenOptions={{
        headerStyle: { backgroundColor: '#0275d8' },
        headerTintColor: '#fff',
        headerTitleStyle: { fontWeight: 'bold' },
      }}>
      <Stack.Screen
        name="Scanner"
        component={CameraScanner}
        options={{ title: 'QR Scanner' }}
      />
    </Stack.Navigator>
  );
}

function SettingsStack() {
  return (
    <Stack.Navigator
      initialRouteName="Settings"
      screenOptions={{
        headerStyle: { backgroundColor: '#0275d8' },
        headerTintColor: '#fff',
        headerTitleStyle: { fontWeight: 'bold' },
      }}>
      <Stack.Screen
        name="Settings"
        component={SettingsScreen}
        options={{ title: 'Setting Page' }}
      />
      <Stack.Screen
        name="Details"
        component={DetailsScreen}
        options={{ title: 'Details Page' }}
      />
      <Stack.Screen
        name="Photos"
        component={PhotosScreen}
        options={{ title: 'Photos Page' }}
      />
      {/*<Stack.Screen
        name="Settings"
        component={SettingsScreen}
        options={{ title: 'Profile Page' }}
      />*/}
    </Stack.Navigator>
  );
}

const FootNavigator = [{
  key : 1,
  module : 'Home',
  name : 'HomeStack',
  tabBarLabel: 'Homee',
  tabBarIcon: ({ color, size }) => (
    <MaterialCommunityIcons name="home" color={color} size={size} />
  ),
  component : HomeStack
},
{
  key : 2,
  module : 'Home2',
  name : 'HomeStack2',
  tabBarLabel: 'Home',
  tabBarIcon: ({ color, size }) => (
    <MaterialCommunityIcons name="home" color={color} size={size} />
  ),
  component : HomeStack
}
];
function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator
        initialRouteName="Feed"
        tabBarOptions={{
          activeTintColor: '#0275d8',
        }}>
        {FootNavigator.map((v, i) => (
          <Tab.Screen
            name={v.name}
            component={v.component}
            options={{
              tabBarLabel: v.tabBarLabel,
              tabBarIcon: v.tabBarIcon,
            }}
          />
          ))}

        {/*
        <Tab.Screen
          name="ListStack"
          component={SettingsStack}
          options={{
            tabBarLabel: 'List',
            tabBarIcon: ({ color, size }) => (
              <MaterialCommunityIcons name="format-list-numbered" color={color} size={size} />
            ),
          }}
        />

        <Tab.Screen
          name="SettingsStack"
          component={ScannerStack}
          options={{
            tabBarLabel: 'QR Scan',
            tabBarIcon: ({ color, size }) => (
              <MaterialCommunityIcons
                name="qrcode-scan"
                color={color}
                size={size}
              />
            ),
          }}
        />
        <Tab.Screen
          name="Camera"
          component={CameraStack}
          options={{
            tabBarLabel: 'Camera',
            tabBarIcon: ({ color, size }) => (
              <MaterialCommunityIcons
                name="camera"
                color={color}
                size={size}
              />
            ),
          }}
        />
        */}
      </Tab.Navigator>
    </NavigationContainer>
  );
}

export default App;
